function BBUpper(source, len, multiplier) {
    let basis = sma(source, len);
    let dev = multiplier * STDev(source.slice(source.length - len));
    return basis + dev;
}

function BBLower(source, len, multiplier) {
    let basis = sma(source, len);
    let dev = multiplier * STDev(source.slice(source.length - len));
    return basis - dev;
