/* Loop Code: */
let candle = record.current;

if (variable.closePrev == undefined) {
    variable.closePrev = candle.close;
}

let trueRange = (variable.closePrev == undefined) ?
                (candle.max - candle.min) :
                Math.max(
                    Math.max((candle.max - candle.min), Math.abs(candle.max - variable.closePrev)),
                    Math.abs(candle.min - variable.closePrev)
                );

// rma Calculation:
let rma = function(src, len) {
    let alpha = 1 / len;
    let sum = (variable.sumPrev === 0) ?
                src :
                alpha * src + (1 - alpha) * variable.sumPrev;
    variable.sumPrev = sum;
    return sum;
}

variable.atr = rma(trueRange, variable.PERIODS);
variable.atrPrev = variable.atr;
variable.closePrev = candle.close;

variable.tp1Up = variable.atr * variable.TPMULT + candle.close;
variable.tp2Up = 2 * variable.atr * variable.TPMULT + candle.close;
variable.tp3Up = 3 * variable.atr * variable.TPMULT + candle.close;
variable.tp1Down = candle.close - (variable.atr * variable.TPMULT);
variable.tp2Down = candle.close - (2 * variable.atr * variable.TPMULT);
variable.tp3Down = candle.close - (3 * variable.atr * variable.TPMULT);
variable.slUp = candle.close - (variable.atr * variable.SLMULT);
variable.slDown = variable.atr * variable.SLMULT + candle.close;

/* Initialization Code: */
variable.PERIODS = 15;
variable.TPMULT = 1;    // Take profit multiplier. default = 100% of ATR.
variable.SLMULT = 1.5;  // Stop Loss multiplier. default = 150% of ATR.

variable.closePrev = undefined;
variable.atrPrev = undefined;
variable.atr = 0;
variable.sumPrev = 0;
if (parameters.periods !== undefined) {
    variable.PERIODS = parameters.periods;
}
if (parameters.tpMult !== undefined) {
    variable.TPMULT = parameters.tpMult;
}
if (parameters.slMult !== undefined) {
    variable.SLMULT = parameters.slMult;
}
